  \"2013-03-15T23:28:30.090730\",\n\t\"name\": \"delaware-well-header-data\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These spreadsheets are a compilation of
  well headers compiled by the Delaware Geological Survey, published as a Web feature
  service for the National Geothermal Data System. The documents contains 10 worksheets,
  including information about the template, notes related to revisions of the template,
  Resource provider information, the data, a field list (data mapping view) and a
  worksheet with vocabularies for use in populating the spreadsheet (data valid terms).
  Fields in the data tables include HeaderURI, WellName , APINo, OtherID, OtherName,
  BoreholeName, ParentWellURI, Operator, MineralOwner, Driller, LeaseName, SpudDate,
  EndedDrillingDate, DrillingMethod, WellType, Status, CommodityOfInterest, StatusDate,
  Function, Production , ProducingInterval , ReleaseDate, County, State, Field, OtherLocationName,
  PLSS_Meridians, TWP, RGE, Section, SectionPart, Parcel, UTM_E, UTM_N, UTMDatumZone,
  LatDegree, LongDegree, SRS, LocationUncertaintyStatement, LocationUncertaintyCode,
  LocationUncertaintyRadius, DrillerTotalDepth, DepthReferencePoint, LengthUnits,
  WellBoreShape, TrueVerticalDepth, ElevationKB, ElevationDF, ElevationGL, FormationTD,
  BitDiameterCollar, BitDiameterTD, DiameterUnits, RelatedResource, Notes, CasingBottomDepthDriller,
  CasingTopDepth, CasingPipeDiameter, CasingWeight, CasingWeightUnits, CasingThickness,
  InformationSource\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
